-- thông báo với MySQL là sẽ làm viêc vói database siteveso
use siteveso_2;

-- tạo bảng DaiVeSo các kênh vé số 
create table daiveso(
id int not null auto_increment,
ten varchar (20) not null,
khuVuc varchar(100) not null,
primary key (id), -- khoa chinh
unique (ten)
);

-- tạo bảng ketqua xo so kien thiet cua cac dai 
create table ketqua(
id int not null auto_increment,
id_dai int,
G8 varchar (2) not null,
G7 varchar(3) not null,
G61 varchar(4) not null,
G62 varchar(4) not null,
G63 varchar(4) not null,
G5 varchar(4) not null,
G41 varchar(5) not null,
G42 varchar(5) not null,
G43 varchar(5) not null,
G44 varchar(5) not null,
G45 varchar(5) not null,
G46 varchar(5) not null,
G47 varchar(5) not null,
G31 varchar(5) not null,
G32 varchar(5) not null,
G2 varchar (5) not null,
G1 varchar(5) not null,
DB varchar(6) not null,
Ngay_XoSo date not null,
AdminID_Tao int ,
Ngay_Tao date ,

primary key(id), -- khoa chinh
Constraint fk_daiveso foreign key(id_dai) references daiveso(id), -- khoa ngoai
Constraint fk_admintao foreign key(AdminID_Tao) references accounts(id), -- khoa ngoai
key index_dai (id_dai,AdminID_Tao) -- index 


)ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8mb4; -- bat dau id bang 1 

-- bang lich su chinh sua 
create table lichsusua(
id int not null auto_increment,
id_ketqua int,
id_user int,
ngay_sua date,

primary key (id), -- khoa chinh

key index_composite(id_ketqua,id_user), -- index
constraint fk_kq foreign key(id_ketqua) references ketqua(id), -- khoa ngoai
constraint fk_user foreign key(id_user) references accounts(id) -- khoa ngoai

)ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;

